import App from './App'

function Login() {
    return (
        <React.Fragment>
            <App active="login"/>
            <div style={{ height: "calc(100vh - 56px)", flexDirection: "column", display: "flex", justifyContent: "center", alignItems: "center"}}>
                <div>
                    <input type="text" placeholder="Username" />
                </div>
                <br />
                <div>
                    <input type="text" placeholder="Username" />
                </div>
            </div>
        </React.Fragment>
    );
}

export default Login;
